class workers{constructor(){this.url="https://ws.beagletech.org/"}async request(t,e,s={}){let r;return await $.ajax({type:t,url:this.url+e,data:JSON.stringify(s),success:t=>{r=t},error:t=>{console.log(t),r=t}}),r}}const update_time=async()=>{let t=new workers,e=await t.request("GET","apk/time");console.log(e)};(function(){const t=document.getElementById("user_btn");update_time();try{const e=new URLSearchParams(window.location.search).get("type");"user"==e&&setTimeout(()=>{t.click()},333)}catch(t){}})();